function Loads({ loads }) {

  const loadsList = loads.map(load => {
    return (
      <li key={load.id}>
        {load.id}
        <button></button>
      </li>
    )
  })

  return (
    <div className="card">
      <ul>
        {loadsList}
      </ul>
    </div>
  )

}

export default Loads;
